import React, { Component } from "react";
import './home.css';
class Body extends Component
{
    render()
    {
        return(
            <div>
                <h1>Wallet as a Service</h1>
                <br/>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-6">
                            <p className="quote"><span></span><br/>
                            </p>
                        </div>
                    </div>
                </div>
                <div>
                    <a href={"/log"}>Click to login</a>
                </div>
                <div>
                    <a href={"/register"}>Click to Register</a>
                </div>
            </div>
        )
    }
}
export default Body;
